			<p>930521 FT  21 MAY 93 / World News in Brief: Sextuplets 'healthy' Jean Vince, 29, of Grimsby, Humberside, gave birth to sextuplets. The babies, said to be 'healthy and stable', were born prematurely by Caesarian section.</p>
